import React from 'react';
import '../../Utilities/Button.css'

export const Button = ({
    children,
    type,
    onClick
}) => {

    if(this.props.className !== undefined){
        className = this.props.className
    }

    return (
        <button className={className} onClick={onClick} type={type}>
            {children}
        </button>
    )
}
